import {Box,Image,Text,Spacer} from '@chakra-ui/react';
import ReactStars from "react-rating-stars-component";
import React from "react";
import { render } from "react-dom";

const baseStyle = {
    color: "black",
    textDecoration: "none"
  };
  
  const activeStyle = {
    color: "red",
    textDecoration: "none"
  };

function MealList(){
    return(
        <Box>
            <Box display='flex' flexDirection='row'>
                <Box>
                    <span style={{marginRight:"7px"}}>Pages:</span>
                    <button style={({ isActive }) => (isActive ? activeStyle : baseStyle)}>1</button>
                    <button>2</button>
                    <button>3</button>
                    <button>4</button>
                    <button>5</button>
                    <button>6</button>
                    <button>7</button>
                </Box>
                <Spacer/>
                <Box></Box>
            </Box>
        </Box>
    )
}

export default MealList;
